#include "../header.h"

#include <set>

class Solution {
public:
    vector<int> dailyTemperatures(const vector<int>& temperatures) {
        const int n = temperatures.size();
        vector<int> result(n);
        if (set<int>(temperatures.begin(), temperatures.end()).size() == 1) {
            return result;
        }
        for (int i = 0; i < n; ++i) {
            for (int j = 1; j < 10; ++j) {
                if (i + j < n) {
                    if (temperatures[i + j] > temperatures[i]) {
                        result[i] = j;
                        break;
                    }
                }
            }
        }

        vector<pair<int, int>> pairs(n);
        for (int i = 0; i < n; ++i) {
            pairs[i] = make_pair(temperatures[i], i);
        }
        sort(pairs.begin(), pairs.end());
        set<pair<int, int>> indices;
        for (int i = n - 1; i >= 0; --i) {
            if (result[pairs[i].second]) {
                continue;
            }

            auto toPos = indices.upper_bound(make_pair(pairs[i].second, 0));
            while (toPos != indices.end() && toPos->second <= pairs[i].first) {
                ++toPos;
            }
            if (toPos == indices.end()) {
                result[pairs[i].second] = 0;
            } else {
                result[pairs[i].second] = toPos->first - pairs[i].second;
            }
            indices.emplace(make_pair(pairs[i].second, pairs[i].first));
        }
        return result;
    }
};

